import React from "react";
import Card from "../UI/Card";
import classes from "./UserList.module.css";
const UsersList = (props) => {
  return (
    <Card>
      <ul className={classes}>
        {props.data.map((user) => (
          <li>{user.name}({user.age} years old)</li>
        ))}
      </ul>
    </Card>
  );
};

export default UsersList;
